import Customer from './pages/customer';
import Login from './pages/loging';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact>
            {() => <Login />}
          </Route>
          <Route path="/customer">
            {() => <Customer />}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
